DROP TABLE IF EXISTS `profile`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `profile` (
  `content_id` int(11) NOT NULL,
  `active_out` bit(1) NOT NULL DEFAULT b'0',
  `active_in` bit(1) NOT NULL DEFAULT b'1',
  `visible` bit(1) NOT NULL DEFAULT b'0',
  `display_name` varchar(64) DEFAULT NULL,
  `content` text,
  `snippet` tinytext,
  `categories` varchar(64) DEFAULT NULL,
  `tags` varchar(128) DEFAULT NULL,
  `experience` int(11) DEFAULT NULL,
  `cv` varchar(256) DEFAULT NULL,
  `portrait` varchar(256) DEFAULT NULL,
  `image_logo` varchar(256) DEFAULT NULL,
  `image_view` varchar(256) DEFAULT NULL,
  `date_created` date DEFAULT NULL,
  `date_updated` date DEFAULT NULL,
  PRIMARY KEY (`content_id`),
  CONSTRAINT `profile_ibfk_1` FOREIGN KEY (`content_id`) REFERENCES `account` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
